Unpack and install with serial nuber which is in txt file in folder CRACK. If there is some error about disk validation just skip this step and continue installation. AND DO NOT RESTART YOUR COMPUTER, before restart your computer copy files from CRACK folder to folder where is yor eca instalation (X:/ProgramFiles/ECA/vrt2009/) and replace existing file with this file from CRACK. Than you can restart your computer. You don't need to uninstall your eca2006 if you have this program already installed on your computer.
